    __typename
    ... on IdentificationsResult {
      identifications {
        ... on RoleConfig {
          identificationId
          name
          identificationType
          profilePicUrl
          actions
          pipelines {
            pipelineId
            name
            pipelineItemType
          }
        }
      }
    }
    ... on UserIsNotAnAdministrator {
      message
    }
    ... on PipelineNotFound {
      message
      pipelineId
    }
    ... on PipelineNotInUserAccount {
      message
    }
  }
}

